import React from 'react';

const Create = ()=>{
    return(<>
        <div className = "create_note">
            <input type = "text" placeholder = "File Title"/>
            <br/>
            <textarea type= "text" rows = "10" columns = "50" placeholder ="Write your Credential"/>
        </div>

    </>)
}
export default Create;
